    false,nt"url": null,nt"notes": "This annual narrative report for Edwin
    B. Forsythe National Wildlife Refuge: Brigantine Division outlines Refuge accomplishments
    during the 1986 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning, public participation, compliance with
    environmental and cultural resource mandates, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, and safety is given. Habitat management is also covered; subjects
    include wetlands, forests, grasslands, fire management, pest control, water rights,
    and wilderness areas. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, shorebirds, game mammals, animal control,
    marking and bird banding, and disease control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    trapping, wildlife observation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    equipment replacement, communication systems, computer systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"owner_org":
